    id: TryDequeue
    path: src/mscorlib/src/System/Collections/Concurrent/ConcurrentQueue.cs
    startLine: 597
  assemblies:
  - System.Collections.Concurrent
  namespace: System.Collections.Concurrent
  summary: "\n<p>Tries to remove and return the object at the beginning of the concurrent queue.</p>\n"
  remarks: "\n<p>\n<xref href=\"System.Collections.Concurrent.ConcurrentQueue`1\" data-throw-if-not-resolved=\"false\"></xref> handles all synchronization internally. If two threads call <xref href=\"System.Collections.Concurrent.ConcurrentQueue`1.TryDequeue(`0@)\" data-throw-if-not-resolved=\"false\"></xref> at precisely the same moment, neither operation is blocked. When a conflict is detected between two threads, one thread has to try again to retrieve the next element, and the synchronization is handled internally.</p>\n<p>\n<xref href=\"System.Collections.Concurrent.ConcurrentQueue`1.TryDequeue(`0@)\" data-throw-if-not-resolved=\"false\"></xref> tries to remove an element from the queue. If the method is successful, the item is removed and the method returns <strong>true</strong>; otherwise, it returns <strong>false</strong>. That happens atomically with respect to other operations on the queue. If the queue was populated with code such as <code>q.Enqueue(\"a\"); q.Enqueue(\"b\"); q.Enqueue(\"c\");</code> and two threads concurrently try to dequeue an element, one thread will dequeue <code>a</code> and the other thread will dequeue <code>b</code>. Both calls to <xref href=\"System.Collections.Concurrent.ConcurrentQueue`1.TryDequeue(`0@)\" data-throw-if-not-resolved=\"false\"></xref> will return <strong>true</strong>, because they were both able to dequeue an element. If each thread goes back to dequeue an additional element, one of the threads will dequeue <code>c</code> and return <strong>true</strong>, whereas the other thread will find the queue empty and will return <strong>false</strong>.</p>\n"
  example:
  - 
  syntax:
    content: public bool TryDequeue(out T result)
    content.vb: Public Function TryDequeue(ByRef result As T) As Boolean
    parameters:
    - id: result
      type: '{T}'
      description: "\nWhen this method returns, if the operation was successful, <em>result</em> contains the\nobject removed. If no object was available to be removed, the value is unspecified.\n"
    return:
      type: System.Boolean
      description: >-
        true if an element was removed and returned from the beggining of the <xref href="System.Collections.Concurrent.ConcurrentQueue`1" data-throw-if-not-resolved="false"></xref>

        succesfully; otherwise, false.
  modifiers.csharp:
  - public
  modifiers.vb:
  - Public
  fullName.vb: System.Collections.Concurrent.ConcurrentQueue(Of T).TryDequeue(ByRef T)
  name.vb: TryDequeue(ByRef T)
